import { TabContext, TabList, TabPanel } from "@mui/lab";
import { useState } from "react";

import MasterItemGroupHome from "./masteritemgrouphome";
import MasterItemGroupAdd from "./masteritemgroupadd";
import Tab from "@mui/material/Tab";

function MSGroupDasboard() {
    const [value, setValue] = useState("1");

    const handleChange = (e: React.ChangeEvent<{}>, newValue: string) => {
        setValue(newValue);
    };

    return (
        <div className="w-full">
            <TabContext value={value}>
                <div className="border-b border-divider">
                    <TabList onChange={handleChange} aria-label="Tab MasterItem">
                        <Tab
                            label="MS Dashboard"
                            value="1"
                            className={`cursor-pointer ${
                                value === "1" ? "bg-gray-200" : "bg-white"
                            } border-l border-t border-r rounded-t py-2 px-4`}
                        />
                        <Tab
                            label="Add"
                            value="2"
                            className={`cursor-pointer ${
                                value === "2" ? "bg-gray-200" : "bg-white"
                            } border-l border-t border-r rounded-t py-2 px-4`}
                        />
                    </TabList>
                </div>
                <TabPanel value="1">
                    <MasterItemGroupHome />
                </TabPanel>
                <TabPanel value="2">
                    <MasterItemGroupAdd />
                </TabPanel>
            </TabContext>
        </div>
    );
}

export default MSGroupDasboard;
